import React from 'react';

import { View, Text } from 'react-native';

const RedScreen = () => {
    return (
        <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center', backgroundColor: 'red' }}>
            <Text>Email</Text>
        </View>
    );
};

export default RedScreen;
